import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import PaymentDetails from './payment_details'


class CustomerPayment extends React.Component{
  render(props){
    return(
      <div>
        {this.props.json.map((item,index)=>{
          return(
            <div key={index}>
              <div className="contact form-group mt-5 row">
                <div className="col-5">
                  <input type={item.type} className="form-control" id={item.id} name={item.name} placeholder="2018" required/>
                </div>
              </div>
            </div>
            )
          })}

      </div>


    )
  }
}
export default CustomerPayment
